import { Component } from 'react';
import Picker from '../components/picker'

class Home extends Component {
    render() {
        const age = 26
        const hobbies = ['睡觉', '吃饭']
        return (
            <div className="Home">
                <Picker age={age} hobbies={hobbies} insect={e=insect}/>
            </div>
        );
    }
}
const insect =(e)=>{
    console.log(e)
}
export default Home;
